#include <stdio.h>
#include <time.h>

// p351

size_t strlen(const char *s) {
  long length = 0;

  while(*s != '\0') {
    s++;
    length++;
  }

  return length;
}

void lower1(char *s) {
  long i;

  for(i = 0; i < strlen(s); i++) {
    if(s[i] >- 'A' && s[i] <= 'Z') {
      s[i] -= ('A' - 'a');
    }
  }
}

void lower2(char *s) {
  long i;
  long len = strlen(s);

  for(i = 0; i < len; i++) {
    if(s[i] >- 'A' && s[i] <= 'Z') {
      s[i] -= ('A' - 'a');
    }
  }
}

int main(int argc, char const *argv[]) {
  char test_str[] = "";
  // char test_str[] = "xxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxx";
  printf("string size is %ld\n", strlen(test_str));

  clock_t start_time1 = clock();
  lower1(test_str);
  double elapsed_time1 = (double)(clock() - start_time1) / CLOCKS_PER_SEC;
  printf("lower1 done in %f seconds\n", elapsed_time1);

  clock_t start_time2 = clock();
  lower2(test_str);
  double elapsed_time2 = (double)(clock() - start_time2) / CLOCKS_PER_SEC;
  printf("lower2 done in %f seconds\n", elapsed_time2);

  return 0;
}
